import React from "react";
import EducationContent from "../components/Contents/EducationContents/EducationContent";
import FooterTag from "../components/Layout/FooterTag";

const Education = () => {
  return (
    <React.Fragment>
      <EducationContent />
      <FooterTag />
    </React.Fragment>
  );
};

export default Education;
